import React, { Component } from "react";
import styled from "styled-components";
const Container = styled.div`
  border: 1px solid lightgrey;
  padding: 8px;
  margin-bottom: 8px;
  border-radius: 2px;
`;
class Task extends Component {
  render() {
    return this.props.task.content;
  }
}
export default Task;
